import React from 'react'
import {Row, Col, Input, InputNumber} from 'antd';


{/*
Template
        <TextFieldComp
            label = ":"
            placeholder = "Enter "
            name = ""
        />
*/}

class TextFieldComp extends React.Component {
    render() {
        const {myProp} = this.props;
        return (
            <Col  style ={{margin: '7px'}} span = {4}>
                <Row>
                    <label >{this.props.label}</label>
                </Row>

                <Input placeholder = {this.props.placeholder}/>


            </Col>
        )
    }
}

class NumFieldComp extends React.Component{
    render(){
        function onChange(value) {
            console.log('changed', value);
        }
        const {myProp} = this.props;
        return(
            <div>
                <InputNumber
                    formatter={value => `${value} min`.replace(/\B(?=(\d{3})+(?!\d))/g, ',')}
                    onChange={onChange}
                />
            </div>
        )
    }
}
export {TextFieldComp, NumFieldComp}
